import React,{useEffect,useState} from 'react';
import img1 from "./../img/img2.png";
import styled from "styled-components";
import SearchIcon from '@mui/icons-material/Search';
import "./list.css";
import fireDb from "../firebase";

const Container = styled.div`
   margin-left: 32px;                                           
`

const List1 = () => {

  const [data,setData] = useState({});

  useEffect(()=>{
    fireDb.child("junglewildlifemagazine-default-rtdb").on("value",(snapshot)=>{
      if(snapshot.val() !== null ){
        setData({...snapshot.val() });
      }else{
        setData({});
      }
     
    });
    return () =>{
      setData({});
    };
  }, []);
  console.log("data",data.image.image1);
  return (
        
      <Container>
     
        {Object.keys(data).map((id) =>{
          return(
            <div className="card" key={id}>
            <div className="card-body">
              <img src={data[id].image.image1.url}></img>
              <h3>{data[id].timestemp}</h3>
              <button className="card-btn"><SearchIcon /></button>
  
            </div>
          </div>
         
          );
        }
        
        )}
        
       
      </Container>
  );

  
};

export default List1;
